import java.io.FileInputStream;
						import java.io.InputStream;
						import java.security.*;
						import java.time.ZonedDateTime
						import java.util.Collections;
						import java.util.Map;
						import java.util.HashMap;
						import io.jsonwebtoken.Jwts;
						import io.jsonwebtoken.SignatureAlgorithm;

						def projectDir = context.expand( '${projectDir}')
						String alias = testRunner.testCase.testSuite.project.getPropertyValue("aliasCertyfikatu")
						String haslo = testRunner.testCase.testSuite.project.getPropertyValue("hasloCertyfikatu")
						String plik = testRunner.testCase.testSuite.project.getPropertyValue("plikCertyfikatu")
						String sciezkaDoCertyfikatu = projectDir+'/keys/'+plik

						String input_user_role = testRunner.testCase.getPropertyValue("user_role")
						String input_user_id = testRunner.testCase.getPropertyValue("user_id")

						def project = testRunner.testCase.testSuite.project

						String iss = project.getPropertyValue("iss")
						String sub = project.getPropertyValue("sub")
						String userId = input_user_id ?: project.getPropertyValue("userId")
						String userRole = input_user_role ?: project.getPropertyValue("userRole")
						String aud = project.getPropertyValue("aud")
						String jti = UUID.randomUUID().toString()
						String exp = ZonedDateTime.now().plusMinutes(5).toEpochSecond().toString()

						// utworzenie zmiennej claims, która jest mapą
						Map<String, Object> claims = new HashMap<>();

						//przypisanie do mapy, klucza i wartości
						claims.put("iss", iss);
						claims.put("sub", sub);
						claims.put("aud", aud);
						claims.put("jti", jti);
						claims.put("exp", exp);
						claims.put("user_id", userId);
						claims.put("user_role", userRole);

						String tokenJwt = generujToken(sciezkaDoCertyfikatu, alias, haslo, claims)
						log.info tokenJwt
						project.setPropertyValue("tokenKlienta", tokenJwt)

						public String generujToken(String sciezkaCertyfikatu, String aliasCertyfikatu, String hasloCertyfikatu, Map<String, Object> claims) {
						        try {
						            InputStream input = new FileInputStream(sciezkaCertyfikatu);
						            char[] haslo = hasloCertyfikatu.toCharArray();
						            Map<String, Object> headers = new HashMap<>();
						            headers.put("typ", "JWT")
						            KeyStore keyStore = KeyStore.getInstance(KeyStore.getDefaultType());
						            keyStore.load(input, haslo);
						            Key privateKey = keyStore.getKey(aliasCertyfikatu, haslo);
						            PublicKey publicKey = keyStore.getCertificate(aliasCertyfikatu).getPublicKey();
						            String token = Jwts.builder()
						                    .signWith(SignatureAlgorithm.RS256, privateKey)
						                    .setHeader(headers)
						                    .setClaims(claims)
						                    .compact();
						            return token;
						        } catch (Exception e) {
						            log.info e.getMessage();
						            return null;
						        }
						}

def root = context.expand( '${#TestCase#identyfikatorPacjentaOID}' )

						if (root == 'urn:oid:2.16.840.1.113883.3.4424.1.1.616')
							testRunner.testCase.testSteps['patientXML'].setPropertyValue("resourceXML", "patient-pesel.xml")
						else
							testRunner.testCase.testSteps['patientXML'].setPropertyValue("resourceXML", "patient.xml")
